import React from "react";

const SongArtis = ({ artist }) => {
  return (
    <section>
      <h3>{artist.strArtist}</h3>
      <img src={artist.strArtistThumb} alt="" />
      <p>
        {artist.intBornYear}-{artist.intDiedYear || "Artis dead"}
      </p>
      <p>{artist.strCountry}</p>
      <p>
        {artist.strGender}-{artist.strStyle}
      </p>
      <a href={`http://${artist.strWebsite}`} target="_blank" rel="noreferrer">
        Sitio Web Oficial
      </a>
    </section>
  );
};

export default SongArtis;
